import './App.css';
import { Body } from './Components/Body/Body';
import { Footer } from './Components/Footer.js/Footer';
import { Header } from './Components/Header.js/Header';

function App() {
  return (
    <div className="App">
      <Header/>
      <Body/>
      <Footer year={2023}/>
    </div>
  );
}

export default App;
